import React, { Component } from 'react';
import './App.css';

class Footer extends Component {
    render() {
        return (
            <body className="footer">
                <div>
                <a className="contact" target="blank" aria-label="external link to Yeri Kim's linkedin profile" href="https://www.linkedin.com/in/yeri-kim">
                &#128172;
                </a>
                </div>
            </body>


        );
    }
}

export default Footer;
